import React from "react";
import logo from "../assets/Logo WO Branding-02 1.png";
function Header() {
  return (
    <div>
      <div
        className=""
        style={{
          display: "flex",
          justifyContent: "center",
          alignItems: "center",
          color: "#5D5D5F",
        }}
      >
        <img src={logo} alt="logo" style={{width:'95.872px', height:'92.448px'}}/>
        <h3>Webure</h3>
        <h4>About Us</h4>
        <h4>Services</h4>
        <h4>Career</h4>
        <h4>Clientele</h4>
        <Button></Button>
      </div>
    </div>
  );
}

export default Header;
